self.onmessage = async (e) => {
  const file = e.data;

  try {
    // 1. Grseli Bitmap olarak decode et
    const bitmap = await createImageBitmap(file);
    
    // 2. Boyut Hesaplama (Tamsay garantisi ile)
    let { width, height } = bitmap;
    const MAX_DIMENSION = 1024; // Kalite iin biraz artrdk, performans hala iyi olur

    if (width > height) {
      if (width > MAX_DIMENSION) {
        height = Math.floor(height * (MAX_DIMENSION / width));
        width = MAX_DIMENSION;
      }
    } else {
      if (height > MAX_DIMENSION) {
        width = Math.floor(width * (MAX_DIMENSION / height));
        height = MAX_DIMENSION;
      }
    }

    // 3. OffscreenCanvas Kontrol ve izim
    if (typeof OffscreenCanvas === 'undefined') {
        throw new Error("Taraycnz bu ilemi desteklemiyor.");
    }

    const canvas = new OffscreenCanvas(width, height);
    const ctx = canvas.getContext('2d');

    if (!ctx) {
      throw new Error("Worker: Canvas context oluturulamad.");
    }

    ctx.drawImage(bitmap, 0, 0, width, height);

    // 4. Blob Oluturma
    const blob = await canvas.convertToBlob({
      type: 'image/jpeg',
      quality: 0.6 // %60 kalite yeterli, boyutu drr hzlandrr
    });

    // 5. Base64 Dnm ve Header Temizlii (Worker inde)
    const reader = new FileReader();
    reader.readAsDataURL(blob);
    reader.onloadend = () => {
        const result = reader.result;
        if (typeof result === 'string') {
            // "data:image/jpeg;base64," ksmn burada atyoruz
            // Ana thread'e daha az veri gider, split ilemi ana thread'i yormaz.
            const base64Raw = result.split(',')[1] || result;
            self.postMessage({ success: true, data: base64Raw });
        } else {
            self.postMessage({ success: false, error: "Base64 oluturulamad" });
        }
    };
    reader.onerror = () => {
        self.postMessage({ success: false, error: "Blob okunamad" });
    };

  } catch (error) {
    console.error("Worker Hatas:", error);
    self.postMessage({ success: false, error: error.message || "Bilinmeyen worker hatas" });
  }
};
